b'@fr0gger_ Perl is a good addition. Sum all of column 5:

perl -F -nle '$a += $F[4]}{print $a' FILE

This also has the benefit of demoing CI attacks, perl sees:

BEGIN { $/ = "\n"; $\ = "\n"; }
LINE: while (defined($_ = readline ARGV)) {
    chomp $_;
    $a += $F[4];
}
{
    print $a;
}'

