b"@allenholub I'm a little Python-rusty, so in Perl:

my $a = {};

foreach my $c ( split( '', $input ) ) {
if ( !exists( $a-&gt;{$c} ) { $a-&gt;{$c}=0; } else { $a-&gt;{$c}++; }
}

use Data::Dumper;

print Dumper( \$a );

Took 4 minutes."
